INSERT INTO `ideascolombo` (`id`, `titulo_propuesta`, `nombre_inst`, `nombre_apre`, `ficha`, `programa`, `correo`, `telefono`, `propuesta`, `fecha`) VALUES
(1, 'Prototipo de un modulo de ventilacion respiratoria para la enseñanza y detección de problemas pulmonares', 'ANA ISABEL MEJIA BRUNVIG', 'YUSSEF DOMINGUEZ, VIRGINIA FRANCO, MELISSA MEDINA, LUIS GONZALEZ', '14990661836915', 'TECNOLOGO EN MANTENIMIENTO DE EQUIPOS BIOMEDICOS', 'aimejia@sena.edu.co', '3002029925', 'RESUMEN: El prototipo de un módulo de ventilación respiratoria y un pulmón humano simulado, esta diseñado para realizar pruebas y detección de problemas pulmonares en el sistema respiratorio.\r\nLa Ventilación Mecánica se ha incorporado al tratamiento de la insuficiencia respiratoria en los servicios de neumología, Unidades de Cuidados intensivos, urgencias y actualmente forma parte del plan de formación de carreras en áreas de la salud y del área tecnológica. Médicos, Terapistas, enfermeras y Bio', NULL),
(2, 'PARQUEADERO AUTOSOSTENIBLE', 'CAMILO GUERRERO', 'BRYAN ANDRES PEREZ RAMIRREZ', '1965928', 'TECNOLOGO EN AUTOMATIZACION INDUSTRIAL ', 'bandresperez08@gmail.com', '3008248058', 'Idea principal. \r\nLa idea principal es automatizar un parqueadero que genere energía eléctrica.\r\n\r\nIdea segundaria.\r\nAprovechar el flujo de vehículos entrantes y salientes del parqueadero para generar dicha energía, también aprovechar al máximo el tiempo que están estacionados para medio de celdas o células de energía y transportadoras de energía envíen la energía a transformadores y poder generar dicha energía\r\n\r\nUno de las partes que también se puede aprovechar son los sobre saltos o los bien ', NULL),
(3, 'Apps para Trabajadores', 'Camilo Guerrero', 'Javier Coronado Ramírez', '1965928', 'Automatización Industrial ', 'jhcoronado26@misena.edu.co', '3155571569', 'Uno de los principales Objetivos de mi proyecto es crear una apps ( Aplicación ) dónde facilite el contacto y comunicación con un trabajador: automatizador, mecánico, ingeniero, electricista etc, para así ofrecer un servicio a domicilio al consumidor. \r\nLa cual conlleve una plataforma segura dónde no estén en riesgo tus datos ni tus ingresos. ', NULL),
(4, 'Fundidor de Metales para reutilizacion de materiales ', 'Marvin Ballestero, Lina Leguisamo, Edgar Hernandez ', 'Sebastian Vallejo, Luis kevin Ballesta y kevin Yanes ', '1804613', 'Mantenimiento Mecanico Industial', 'sebastianvallejoguerra@gmail.com-luisballesta02@gmail.com', '3023064063', 'El proyecto se basa en reciclar metales que ya han sido catalogados como desechos, lo que contribuiría al presupuesto del SENA invertido en la compra de materiales utilizado por los aprendices para realizar sus actividades y esto se lograría mediante la fabricación de un horno de inducción electromagnética que sea capaz de fundir los metales que ya han sido utilizados y devastados dentro de las áreas de metalmecanica (soldadura, mecanizado, mantenimiento). ', NULL),
(5, 'Generación de Energía no Convencional Renovable', 'Segundo Rafael Olivera Martinez', 'Jader Luis Galvan Sanchez', '1962719', 'Técnico en Soldadura en Platina', 'jaderluis30x100@hotmail.com', '3188768015', 'Construcción de un prototipo de una plataforma de emplazamiento de un sistema de generación de energía no convencional renovable, a partir del aprovechamiento de la fuerza sinetica de la corriente del rió y transformarla en corriente alterna.', NULL),
(6, 'Implementación de un programa de lubricación efectiva dirigido al mejoramiento de equipos y reducción de daños ambientales u ocupacionales.', 'Marvin Ballesteros Garrido', 'Luissy Dinelly Viloria Gallardo', '1697138', 'Mantenimiento mecánico industrial ', 'lus.viloria.21@hotmail.com, mabaga@misena.edu.co', '3012465710.3023739036', 'El proyecto consiste en el diseño de un programa formal de lubricación efectiva, el cual hace parte de la lubricación centrada en la confiabilidad (LCC). La implementación de este programa permitirá optimizar el funcionamiento de los mecanismos de los equipos rotativos alcanzando su vida útil, mejorar los tiempos de mantenimiento, reducir costos de operación, clasificar y disposicionar adecuadamente los lubricantes con el fin de minimizar riesgos ocupacionales y daños al ambiente por fugas o der', NULL),
(7, 'PROCESADOR INDUSTRIAL DE EMPANADAS', 'camilo guerra ', 'rafael florez ', '1965928', 'automatización industrial', 'rafaeladrian.florezdiaz00@gmail.com', '3013451411', 'Mi principal objetivo es hacer el trabajo mas fácil, ¿en que sentido? si nos ponemos a hacer cuenta del tiempo que gasta en la manufactura del producto es considerablemente  bastante y pese a ello logra gran cantidad de producto hecho.\r\nme quiero encargar de desarrollar e implementar un objetivo en especial en el que su base fundamental es el ahorro y sostenibilidad.\r\nAl cual le eh puesto como nombre a mi prototipo de de objetivo AHORRO DET (Ahorro Dinero, Energía, Tiempo). Ademas va de la mano ', NULL),
(8, 'BOMBA DE CIRCULACIÓN CONTROL DE FLUJO PARA BOMBA PERISTÁLTICA', 'jacinto torres ', 'yeins vargas guerrero', '1836915', 'mantenimiento de equipos biomedicos ', 'ghiroyui@hotmail.com', '3003557031', 'la propuesta se basa en la mejora del rendimiento de  a bomba peristaltica, para uso ya sea en las maquinas de diálisis, como en bombas de infusión   ', NULL),
(9, 'Puerta Automatizada', 'Gerson monsalve', 'Juan David Padilla de Alba/ Sergio Andres Bruno Castillo/ Fernando Barros', '1904772', 'implementación y mantenimiento de equipos electrónicos industriales ', 'juandavidpadilla99@gmail.com/ sergiobrunoc2019@gmail.com', '3024374976', 'realizar una puerta automatizada para un publico con limitaciones ya sea físicas o mental.\r\nque pueda asegura y abrir el cerrojo de la puerta a distancia con un control (estilo el de las puertas de los carros) y que al acercarse se abra con sensores, para una mayor seguridad de la casa, implementar una pantalla pequeña que indique quien entro, salio y que hora de la casa o otros.', NULL),
(10, 'bienestar optimizado ', 'Gerson monsalve ', 'elian enrique ruiz de la rosa ', '1904759', 'implementacion y mantenimiento de equipos electronicos industriales ', 'elianenrrique1@hotmail.com', '3620078', 'diseñar un sistema operativo mediante el código de barra del carnet estudiantil  ,que permita leer los datos del aprendiz (hoja de vida) , agilizando y siendo efectivo el registro de la asistencia de los aprendices a los eventos .\r\neste proyecto se enfocara en reducir los tramites y papelería que requieren los eventos de bienestar estudiantil  por parte de los aprendices y personal en cargado. A través de la implementacion de un sistema operativo que registre la hoja de vida del aprendiz mediant', NULL),
(11, 'Sistema Robotizado para la entrega de herramientas ', 'Camilo Guerrero ', 'Jonatan gonzalez, anthony peralta, jeansat perez, anibal remolina, jesus rivera', '1904810', 'DIAM 26', 'gonzalezjjonatan@gmail.com', '3016334828', 'SISTEMA ROBOTIZADO PARA LA ENTREGA DE HERRAMIENTAS \r\n\r\n\r\nLa idea se trata de solucionar los problemas al momento de entregar herramientas a nivel industrial, implementando un sistema de traslado de herramientas del lugar almacenado al lugar establecido por el usuario.\r\nEl sistema contaría de una programación para realizar la entrega con la mayor efectividad tanto en tiempo como en rendimiento.', NULL),
(12, 'Transmisión ultrasonica. Micrófono de Cristal piezoelectrico convertido en estetoscopio', 'Jacinto Torres', 'Daniela Torres Riquett. Ronaldo Andrade. Nayarith Ramirez', '1836915', 'Tecnologo en Mantenimiento de Equipo Biomedico', 'jecaosib@gmail.com', '3002662280', 'Se adaptara un micrófono de crista piezoelectronico para ser usado como un estetoscopio electrónico que nos permita detectar y medir el pulso carotìdeo. Los transductores a base de cristal piezoelèctrico tienen la ventaja obre los demás que no està limitado al uso en el aire. Ademas, se puede usar fácilmente en diferentes frecuencias ultrasònicas. \r\nEstos cristales son sinteticos aunque la antigüedad se utilizaban naturales, y eso a ayudado a bajar lo indice de explotación minera en lugares dond', NULL),
(13, 'Aplicativo', 'sivelys sarmiento crespo', 'cristian camilo lopez martinez', '1784014', 'análisis y desarrollo de sistemas de información', 'crca9623@gmail.com', '3006965383', 'crear una App para gestionar ventas e inventarios de tiendas Online, para mejorar la administración de estas micro empresas, que están teniendo gran importancia en el mundo laboral.', NULL),
(14, 'Dispositivo de detección de obstáculos para personas invidentes', 'Camilo Guerrero', 'Jeanseth Pérez Bula, Kleider Yanez Caballero, Virgilio Mendoza, Jonatan Gozalez jimenez', '1904810', 'DIAM 26', 'jeansperez.jp@gmail.com', '3022090726', 'Es un dispositivo Electrónico diseñado para mejorar la movilidad de las personas con discapacidad visual. Este dispositivo sera capaz de detectar los obstáculos cercanos y advertir de su presencia al usuario.  El diseño de este dispositivo sera fabricado en PLA, el cual es un material amigable con el medio ambiente. Se pretende Diseñar un dispositivo el cual posea una buena portabilidad al usuario.  ', NULL),
(15, 'Aprende hablando', 'Govanis zarco', 'David Florez Sarmiento', '1962913', 'Técnico en sistemas', 'dflorez6659@gmail.com', '3701032', 'Alguna vez no haz querido hablar ingles  pero no encuentras con quien o donde encontrar gente con quien hablar he así practicar tú speaking y listening?  Pues yo si he tenido muchas ganas de aprender ingles escuchando muchos estudiantes tienen muy buen nivel de ingles cuando lo están escribiendo pero al momento de hablar o escuchar nunca se pueden desenvolver, pues yo quiero sugerir crear una plataforma o aplicación en la que cualquiera pueda entrar y charlar en diversos idiomas solo con un clic', NULL),
(16, 'child safety bracelet', 'Luz Jiménez ', 'Nini mercado ', '2022711', 'Instalaciónes de redes internas de telecomunicaciones', 'nynachel13@gmail.com', '3126336831', 'Hola buenas... Mi idea se basa en un brazalete cuya función sería para el cuidado de los niños tendría un GPS que sería conectado al celular de la madre o padre que en caso de pérdida o secuestro puedan saber su ubicación exacta... También tendría una luz fluorescente y una alarma que puede sonar y visualizar en el teléfono de la madre así el niño este  debajo del agua si se presenta que el niño puede estar ahogándose o en peligro medidor de signos vitales... un botón de encendido y uno de llama', NULL),
(17, 'Ciclistas Visibles', 'Oscar', 'Isaias Trespalacio', '2024671', 'Seguridad Digital', 'trespalaciio@gmail.com', '3014343732', 'Con chalelos añadirles luces direccionales para que los ciclistas puedan ser vistos en las noches, para intentar reducir los accidentes y muertes de muchos ciclistas', NULL),
(18, 'Simulador De Electro Cardiograma o ECG', 'Ana mejia', 'Luis Fernando Gonzales Reales, Melissa Alejandra De Medina Mendoza, Miguel Angel Henao Betancur, Pamela Susana Maestre Reyes', '1836915', ' Tecnologo Mantenimiento De Equipos Biomedicos', 'miguelangelhenaobetancur@gmail.com', '3012441114', 'El origen del simulador se debe a sugerencias a través de varios años, de\r\nparticipantes en talleres de interpretación de arritmias cardíacas. Numerosos participantes notaron que usando un simulador con un monitor cardíaco era una manera muy efectiva de aprender las diferentes arritmias del corazón-una experiencia muy similar a la realidad sin poner en riesgo la salud o la vida de ningún paciente.\r\nPero para mejorar la calidad del aprendizaje del ingeniero Biomédico en esta sección se propone el', NULL),
(19, 'Medición de la frecuencia respiratoria haciendo uo de un termistor ', 'Jacinto Torres y Ana Mejia ', 'Marleidis Hernandez Oyola, Juan Camilo Gonzalez Romero, Jesus David Barraza, Adolfo Antonio Arevalo Yepez', '1836915', 'Mantenimiento de Equipos Biomedicos ', 'gonzalezromerj@gmail.com', '3002014528', 'La frecuencia respiratoria es uno de los signos vitales que se deben monitorear \r\nUno de los signos vitales más importantes que se deben monitorear en los pacientes de terapia intensiva es la frecuencia respiratoria. La frecuencia respiratoria dentro de los límites normales es de 14 a 16 respiraciones por minuto en reposo, y esta frecuencia se incrementa durante el ejercicio llegando incluso a ser un poco más de 22 respiraciones por minuto durante el ejercicio. En los pacientes de terapia intens', NULL),
(20, 'Motor cuantico', 'Camilo guerrero', 'González Barreto Denilson', '1965928', 'Tai 20', 'dgonzalez5958@misena.edu.co', '3002846173', 'Motor cuántico auntosustentable de energía renovable.  si combustibles fósiles ', NULL),
(21, 'AUTOMATIZACIÓN DE AMBIENTES DE CLASES', 'GERSON MONSALVE', 'JORGE LUIS CALDERÓN LUNA, SERGIO REDONDO MONROY, DANIEL CASSALIN', '1835367', 'TECNOLOGÍA EN AUTOMATIZACIÓN INDUSTRIAL', 'jorgeluiscalderon2001@hotmail.com ; slredondo7@misena.edu.co', '3007081506', 'Este proyecto busca la automatización de ambientes de clases con la finalidad de hacer corregir y mejorar aspectos en el. Se han venido presentando en repetidas ocasiones perdidas de materiales e instrumentos dejados en el aula, por tal motivo se busca implementar un sistema de seguridad basados en microcontroladores el cual le permita el acceso solo a personal autorizado, y así mismo guarde un registro de hora y usuario para posteriormente hacer investigaciones en dado caso que ocurra una perdi', NULL),
(22, 'SISTEMA DE RIEGO AUTOMATIZADO ', 'Gerson Monsale', 'Adrian Santana, Freddy Cervantes, Federico De Oro', '1904772', 'IMMEI-7 (Implementación y mantenimiento de equipos electrónicos institucionales)', 'adrianantonio4321@hotmail.com - deorogutierrez0224@gmail.com  - Freddycervantesn@hotmail.com', '573008331132', 'Sistema de riego automatizado\r\n\r\nLas plantas y lugares con necesidad de riego demandan mucho cuidado, el cual se relaciona con el tiempo que se le dedique a el y especialmente con el clima que se presenta en nuestra región, se buscamos implementar un sistema de riego automatizada y autónomo, que pueda ser utilizado en un jardín, un parque, una cancha, una finca, etc. Este producto evitará costos de energía eléctrica y agua potable ya que se utilizarán paneles solares y un tanques qué almacenaran', NULL),
(23, 'S. O. S APRENDIZ', 'Gerson monsalve', 'Marlon pelaez, jhon cuevas ', '1904759', 'IMEEI 8', 'marlon20octubre@gmail.com', '3015542660', 'Esta idea surge a la necesidad del aprendiz, para que este sea ayudado.\r\nhe evidenciado mucha desconsentración en las aulas, esto bajá el rendimiento del aprendiz, mí propuesta es crear un aula para que los aprendices descansen pero para ingresar deberán poner la huella y así ser tomada la asistencia y saber que personas tienen inconvenientes y poder ayudarlas, este sistema también puede ser implementado en las aulas de clases y saber que personas fallan constantemente, detectar posibles deserto', NULL),
(24, 'RIEGO AUTOMATIZADO DE LOS JARDINES SENA', 'Gerson Monsalve', 'Breyner de la rosa, Luis Acevedo, Asdrubal meza, jorge calderón', '1835367', 'tecnologo en automatización indsustrial', 'jorgeluiscalderon2001@hotmail.com', '3007081506', '\r\nLa automatización en la actualidad ha tomado un valor muy grande con el paso de los años, obteniéndose consigo la eficiencia en muchos procesos. En los ambientes SENA COLOMBO ALEMÁN hemos notado el inconveniente producido con el riego de jardines, en realidad se ha convertido en una tarea agobiante para la mayoría del personal encargado. Por tal motivo, se busca implementar un sistema cien por ciento acto y preparado para cumplir esta labor. Así mismo diseñado con la cautela de cuidar y proteg', NULL),
(25, 'jardin automatizado', 'Gerson Monsalve', 'Kavith Romero', '1835367', 'tecnologo en automatización industrial', 'kavith.romero@hotmail.com', '3014510800', 'El proyecto a tratar se centra en la automatización del riego de las plantas de manera automática, que, por medio de aspersores controlados por un sistema embebido (Arduino mega) que regule el riego de las plantas, teniendo en cuenta ciertos parámetros, tales como la hora, la cantidad de plantas y de agua para que su temperatura y humedad estén en condiciones óptimas para que las plantas florezcan adecuadamente; Además el jardín estará energizado con paneles solares con el fin de trabajar con en', NULL),
(26, 'ISP para Tazajera Magdalena', 'LUZ ELENA JIMENEZ', 'JAIRO JOSE BARANDICA PADILLA', '2022711', 'IRIT # 6 Instalacion de Redes Internas y Telecomunicaciones', 'jairoministro@gmail.com', '3023534121', 'Crear  una empresa pro-activa y retroactiva en busca de mejorar el funcionamiento de instalar Redes, antenas que distribuya Internet en zonas vulnerable para acceso debido proceso y a la vez va a permitir que las personas que estudien redes en el SENA hagan sus practicas o trabajen con este proyecto en mantenimiento de antenas y redes, es muy amplio porque pienso abarcar con la ayuda de Dios y del SENA muchos sectores. \r\nSuscribirnos en el ministerio de las telecomunicaciones y legalizar así el ', NULL),
(27, 'maltrato a los animales ', 'julio César castaños bustos ', 'Kevin Andrés González Visbal ', '2024767', 'programación de software ', 'ka568948@gmail.com', '3006768395', 'Hoy en dia vemos que decenas de animales son maltratados ya que lo cual comemos la piel de ellos para satisfacer nuestras necesidades ya que en el caso de los perros hay personas que los educa para que sean bravo ya que lo cual ellos no tienen la culpa de que su naturaleza sea haci pero si los educamos bn ellos nos no harán daño ', NULL),
(28, 'Recuperaciòn de aceite de cocina usado con fines industriales.', 'Freddy Sanjuan. Luis Carlos Fabregas', 'Yessica paola muñoz coronado', '1751791', 'Gestión de la Producción Industrial', 'ypmunos6@misena.edu.co', '3122661291', 'En la actualidad el aceite de cocina usado en la Ciudad de Barranquilla es vertido al desagüe y en otras ocasiones  vertido al suelo directamente contaminando nuestras fuentes hidricas y nuestro suelo lo que ocasiona un impacto medioambiental negativo para todos los habitantes. Esta propuesta se fundamenta, en una primera instancia, generar conciencia en la población acerca de esta problemática logrando que las disposición de este tipo de residuos se haga de forma adecuada con respecto a la norm', NULL),
(29, 'Proyecto generador eléctrico eólico automatizado', 'Jose Ramirez ', 'Francisco Vidal Pinto', '2024819', 'Diseño e integracion automatismo mecatronico', 'francisco_vidalp@hotmail.com', '3017275715', 'EN NUESTRO PROYECTO USAREMOS LA TURBINA SOVONIUS, UTIL PARA ZONAS URBANAS DONDE HAY POCO VIENTO. LE AÑADIMOS UNA CAJA ATRAPA AIRE EL CUAL DIRIGE LA ENERGIA CINETICA A LA PARTE POSTERIOR ADEMAS CUBRIREMOS LA PARTE OPUESTA CON EL OBJETIVO DE DISMINUIR LAS ERDIDAS DE ENERGIA ESTE SISTEMA NOS PERMITIRA MEJORAR EL COP DEL LA TURBINA SAVONIUS Y ESPERAMOS LLEGAR A UN 0.5 DE APROVEECHAMIENTO DE LA ENERGIA DEL VIENTO. ESTAS MEJORAS SERIA DE MODO MECANICO. \r\nA NUESTRA TURBINA YA MEJORA DE POR SI, ANEXAMOS', NULL),
(30, 'CULTIVO DE FRESA EN AMBIENTES NO NATIVOS', 'Jhon Eduard Montenegro', 'Omar José Carrillo Berdejo', '1904138', 'Mantenimiento de equipos de Refrigeración, climatización y ventilación.', 'omar.c.b@hotmail.com', '3002760699', 'En las últimas décadas los desarrollos tecnológicos han dado avances muy significativos en el sector agrícola, climático y geotérmico. Los resultados de estudios científicos en la temperatura del planeta tierra han evidenciado ciclos de enfriamientos súbitos y calentamientos extremos; el cambio climático es una realidad, actualmente se evidencia el incremento acelerado de la temperatura debido a la contaminación ambiental lo que conlleva a una disminución del espesor de la capa de ozono que ocas', NULL),
(31, 'CENTROS DE ROTACIÓN DEPORTIVA INCLUYENTE Y COMUNITARIOS ', 'JOSÉ VILLADIEGO', 'JONNATAN CARIAGA ROCHA', '2019006', 'TECNICO EN EJECUCION DE PROGRAMAS DEPORTIVOS', 'cariagajonnatan@gmail.com', '3002686479', 'Dar la oportunidad a todos los niños  en edades entre los 6 y 12 años, de rotar por un grupo específico de deportes (convencionales y no convencionales)  por un tiempo determinado, para apoyar el estímulo de hábitos saludables, aprendizaje de valores, capacitación y otros,  e incentivar la cultura deportiva como método  de crecimiento social, es decir, más personas aspirando a formación profesional en las diferentes áreas de la vida cotidiana.\r\nLos CENTROS DE ROTACIÓN DEPORTIVA INCLUYENTE Y COMU', NULL),
(32, 'Diseño y elaboración de accesorio médico asistencial y de diagnóstico para electrocardiografo  sensory vest', 'Ana María Mejía Bruving', 'Jean Carlos Osorio Ibarra, Franco Elías Escorcia Escorcia', '1836915', 'Tecnologo en mantenimiento de equipo biomédico', 'j.osorio2002@gmail.com', '3002662280', 'Se quiere diseñar un arnés de textil inteligente con sensores de frecuencia para recolectar señales y datos que serán enviados a la nube y, posteriormente, se procesara la información para graficarla en el electrocardiógrafo o tenerla en forma digital.\r\nEl dispositivo recolecta las señales de las derivadas precordiales haciendo más rápido y práctico un examen de ECG, solo basta con ajustar el arnés para que inicie  la representación  de  la actividad eléctrica del corazón en función del tiempo, ', NULL),
(33, 'Diseño e implementación de vehículos aeros no tripulados ', 'Germán Ochoa', 'Jose borja, juan Cueto, Juan castro', '1968260', 'Imeei9', 'jose.a.borja.v@gmail.com', '3007669883', 'Diseño e implementación de vehículos aéreos no tripulados (uav por sus siglas en inglés,Unmaned Aerial Vehicle)  para diferentes aplicaciones:\r\nControl del peligro aviario en aeropuertos, búsqueda y rescate, fotografía aérea ', NULL),
(34, 'Cascos RETMUS', 'Salim Giha', 'CRHISTIAN MANUEL GUZMAN VILORIA', '1904171', 'T.E.I 33', 'crhisgv@gmail.com', '3002935885', 'es un casco que se sincroniza con la moto de forma inhalambrica para mejorar la seguridad del conductor. asi disminuyendo el indice de accidentalidad y robo de las motocicletas. cuenta con sistema GPS para dar su ubicación en cualquier sitio. \r\nel sistema de Audio sirve para conectarse a su  celular con bloetooth para atender llamadas y escuchar música.\r\nel sistema de led nos permite mejorar la visibilidad de la placa del vehículo.\r\n', NULL),
(35, 'Draw Hologram', 'Nelson Miranda', 'Eliana Maylin Betancourt Peralta', '1834768', 'Tecnico en Sistemas', 'embetancourt0@misena.edu.co', '3015658900', 'Trata de una pequeña maquina que se conecta a cualquier dispositivo donde se pueda realizar un dibujo y que este reproduzca un holograma, sea 2D o 3D donde se pueda apreciar mejor los detalles del mismo. También tendrá un guante controlador, con el cual se podrán realizar diferentes movimientos al holograma.     ', NULL),
(36, 'Casillero con seguridad biométrica ', 'Gerson Monsalve', 'Carlos Calderón ', '1904759', 'Implementación y Mantenimiento de Equipos Electronicos Industriales', 'carloscalderon098@gmail.com', '3118325771', 'Este proyecto está enfocado en la necesidad que se ha visto reflejada en el Centro Colombo Aleman, de proteger los bienes institucionales y personales que no pueden ser ingresados a los ambientes de aprendizaje. Teniendo en cuenta la herramienta actual para asegurar los casilleros ( Candados) se ha observado incidentes de robos y manipulación indevida en estos. además muchos aprendices Sena han dejado pertenencias guardados sin seguridad en los actuales casilleros por diferentes circunstancias.\r', NULL),
(37, 'La VILED 2001 (Prototipo para la recolección de magos )', 'Camilo Guerrero ', 'Lina Marcela De Alba Perez ', '1965924', 'DISEÑO E INTEGRACIÓN DE AUTOMATISMO  MECATRONICO ', 'linamarcela300259@gmail.com', '3053485787', 'esta trabajara con el fin de recoger, clasificar, lavar, secar y envasar los mangos que se encuentren en la tierra.\r\n este sera hecho para laborar en los lugares rurales, ayudando a los agricultores a la recolecta en temporada de mango, para que así sea un proceso mas rápido y de beneficencia. \r\nse tendrá en cuenta la sequías y las altas lluvias, su carga sera con energía fotovoltaica.\r\nproyecto basado en una necesidad real de mi familia, sitio nuevo magdalena.   ', NULL),
(38, 'Dynamic Waste Game', 'Camilo Guerrero ', 'Melyis Tatiana Manigua Chacón', '1965924', 'Diseño e integración de automatismos mecatrónicos', 'mtmanigua4@misena.edu.co', '3045347678', 'Diseñar un dispositivo educativo dinámico para instruir en el proceso de reciclaje.\r\nEn la actualidad las personas desconocen las tres categorías para desechar la basura en las canecas, debido a esto se hace difícil el reciclaje de muchos desechos generando contaminación, por tal motivo se pretende implementar un juego que de manera rápida y dinámica las personas interactúen por medio de imágenes aprendiendo la clasificación de cada tipo de basura.', NULL),
(39, 'Dispositivo corrector de postura corporal inteligente', 'Camilo Guerrero', 'Elías Darío Reyes Caro, José Armando López Coronell, Katia Hernández', '1904810', 'Diseño e integración de automatismos mecatrónicos', 'edereyes6@misena.edu.co; jalopez327@misena.edu.co', '3022372871', 'Sistema inteligente que notifica al usuario o portador cuando el torso se encuentra en una mala posición de pie o sentado,  esto mediante un brazalete o una banda aplicada en la parte frontal del tórax. Lo anterior mencionado es implementando tecnologías de bajo costo.', NULL),
(40, 'DOG (Desfibrilador, Oscilador, Glucómetro)', 'Jhon Salzedo', 'Jorge Antonio Elías Pérez; Melyis Tatiana Manigua Chacón', '1965924', 'Diseño e Integración de Automatismos Mecatrónicos', 'jorgeantonioeliasperez@hotmail.com', '3024315295', 'Consta de una unidad ligera de primeros auxilios que compacta un sistema de desfibrilación, un oscilador, un glucómetro y un sistema de monitoreo, diseñado estratégicamente para su uso en lugares de altas concentraciones de personas, de uso rápido, a la mano, y una herramienta que posiblemente disminuya los índices de muerte por falta de apoyo médica oportuno. ', NULL),
(41, 'Desarrollo de un Sistema inteligente de monitoreo y visualización de variables de proceso a través de realidad aumentada', 'Elkin Pertuz / Freddy Sanjuan / Heiner Cabarcas', 'Jesus David Monsalve Villalobos', '1904759', 'Integración y Mantenimiento de Equipos Electrónicos Industriales', 'epertuzr@sena.edu.co', '3046642694', 'Los bajos niveles de digitalización de la información en los procesos de producción de la pymes y minipymes representan la primeras barreras para su integración con el concepto de industria 4.0.\r\nEl presente proyecto permitirá optimizar los procesos de producción en las pymes y minipymes de la ciudad de Barranquilla, gracias a la captura de los datos generados en sus procesos productivos y presentarlos mediante la interfaz de visualización en realidad aumentada mediante la interacción del operad', NULL),
(42, 'La rugosidad como factor de influencia en la medición de la microdureza del Latón', 'Freddy Sanjuan Salcedo', 'Pablo Andrés Barraza Artuz', '2022726', 'Diseño de Elementos Mecánicos para su fabricación con Máquinas Herramientas CNC', 'fsanjuan@sena.edu.co; pablobarraza08100@gmail.com', '3046111757', 'Uno de los ensayos de mayor aplicación en la industria metalmecánica al momento de realizar un análisis de falla es el de dureza ya que esta se encuentra directamente relacionada con la resistencia del material. Un análisis de falla adecuado permite, tanto a diseñadores como fabricantes de materiales para construcciones mecánicas, tomar decisiones  certeras que permitan contribuir con la no ocurrencia de la falla en el material. Por esta razón se considera importante que los resultados de la  me', NULL),
(43, 'Trimer relay en aplicación', 'Yerson monsalve ', 'Randol Pérez, Andrés ardila, Jair Sarmiento, Duvan navarro', '1904772', 'Implementación y mantenimiento de equipos electrónicos industriales ', 'elrandolyo@gmail.com', '3012752390', 'Principalmente la idea que se desarrollaría empleando el relé temporizador sería crear una opción alternativa para los padres al querer implantar una hora de dormir para sus hijos De manera que colocando un relé temporizador en una zona estratégica de sus casa y una configuración adecuada podrían estimar una hora en la que se abrirían los circuitos que conduzcan electricidad a los dispositivos electrónicos y luces o lámparas excepto los que mantienen conectados los dispositivos de su elección ya', NULL),
(44, 'desarrollo de equipos mecánicos que contribuyen al reciclaje y a la democratizacion del uso de materiales plásticos en PET ', 'camilo guerrero', 'Jose carlos torres-Anthony peralta-Jeison David Vegara Martinez-Leiner Osorio-Elias David Guerra ', '1904810', 'D.I.A.M 26', 'jctorres11@misena.edu.co', '3013551195', 'continuaremos el proyecto de la trituradora de plástico para darle uso útil a este , triturando el plástico para convertir los filamentos del plástico PET , llevándolo a la impresora 3D para diseñar , moldear ademas de reciclar dichos plásticos que se encuentran en los centros de formación sena.', NULL),
(45, 'Cubicar madera con vision artificial para mejor el proceso de recepción', 'Jose Ramirez - Wilman Ariza- Freddy San Juan', 'Jeanseth Elliot Pérez Bula - Jonatan Gonzalez Jimenez  - Kleider Yanez', '1904810', 'Diseño e integracion de automatismos mecatronicos', 'jeansperez.jp@gmail.com - gonzalezjjonatan@gmail.com', '3022090726', 'En los aserraderos de la ciudad de Barranquilla el procesamiento de la madera se inicia con la recepción de la misma, esta etapa consiste en dimensionar los listones, es decir ancho, largo y alto. Actualmente esta etapa se realiza manualmente es decir un operario con la ayuda de un flexo metro empieza a medir listón por listón, esta etapa del proceso es muy demorada ya que la cantidad de listones a medir puede ser muy grande (2000)\r\nCon la propuesta de realizar la medición con visión artificial ', NULL),
(46, 'AUTOMATIZACIÓN PARA SEGURIDAD DE BICICLETAS.', 'GERSON MONSALVE.', 'LIBARDO CASTILLO MUÑOZ - CRISTIAN HERRERA MUÑOZ - JADIR QUINTO - ADALBERTO DE LA HOZ', '1904759', 'IMPLEMENTACION Y MANTENIMIENTO DE EQUIPOS ELECTRÓNICOS INDUSTRIALES', 'lacastillo50@misena.edu.co', '3145260832', 'IMPLEMENTAR UN SISTEMA DE SEGURIDAD, EN EL ESTACIONAMIENTO DE BICICLETAS, QUE PERMITA LA IDENTIFICACIÓN DEL VEHÍCULO EN CUSTODIA POR MEDIO DE LECTOR DE CÓDIGO DE BARRAS PRESENTE EN EL CARNET DEL APRENDIZ. ESTE CONTARA CON UNA BASE DE DATOS CAPAZ DE REGISTRAR Y GUARDAR DE MANERA SEGURA ESTE VEHÍCULO Y SE EVITE DE ESTA FORMA EL HURTO DEL BIEN, ESTE SISTEMA SERA AUTO SOSTENIBLE YA QUE TENDRÁ  PANELES SOLARES, BRINDANDO AL CENTRO NACIONAL COLOMBO ALEMÁN EFICIENCIA, SEGURIDAD Y AHORRO. ', NULL),
(47, 'Multillave portátil', 'Carlos Beleño Machuca', 'Jennifer Garcia Cañate, Indira Tarriba Barragán ', '1835384', 'Tecnología en Aseguramiento Metrológico Industrial', 'jgarcia351@misena.edu.co   itarriba@misena.edu.co', '3012786591.3106851831', 'Proponer de una herramienta de diversos usos en el área de Metalmecánica con el fin de facilitar el ajuste de las piezas en las máquinas que empleamos en la realización de las mismas, disminuyendo el  tiempo de trabajo.', NULL),
(48, 'ENERGIAS LIMPIAS ', 'JONIS ORTEGA', 'JOSE DEL VALLE-BRYAN POMARICO CARRILLO-JUAN MENDOZA-PEDRO BARRAZA', '1968260', 'IMPLEMENTACION Y MANTENIMIENTO DE EQUIPOS ELECTRONICOS INDUTRIALES', 'joseantonio199220@gmail.com - brayan25_p@hotmail.com - jjmendoza25@outlook.es', '300218682730160153463007048209', 'Nuestra propuesta esta basada en energias limpias tales como energia solar energia eolica etc, dirigida a las personas del campo de bajos recursos para mejorar su calidad de vida y su productividad.', NULL),
(49, 'Sistemas embebidos como plataforma de la Inteligencia Artificial para utilizarla en la estrategia de enseñanza aprendizaje', 'Manuel Salvador Briceño Pérez', 'Emanuel David Solarte Borda', '1748739', 'Mantenimiento de Equipos de Cómputo, Diseño e Instalación de Cableado Estructurado', 'edsolarte8@misena.edu.co', '3043405961', 'El uso de la tecnología promueve en la sociedad el desarrollo, evidenciado en como las revoluciones industriales y sociales forjan un cambio en las posteriores generaciones, factor clave, el cual es importante marcar como relevante ya que tiene una gran influencia intrínseca en lo cotidiano de nuestra especie, por ende, constantemente se deben buscar, estructurar e idear nuevas formas de tecnología.\r\nTambién existe un método el cual simplificaría el tiempo de desarrollo social hasta un nivel sum', NULL),
(50, 'SISTEMA DE RIEGO AUTOSUSTENTABLE Y AUTOMATIZADO   DE AGUA PURIFICADA. ', 'Ing. Candelaria Suárez B. / Instructor Técnico Vocero ? ADSI', 'johan danilo balbin mazo', '1881614', 'analisis y desarrolo de sistemas informaticos (ADSI)', 'johanbalbinmazo1@gmail.com', '3506735257', 'SISTEMA DE RIEGO AUTOSUSTENTABLE Y AUTOMATIZADO   DE AGUA PURIFICADA. \r\n\r\nEs una idea pensada en el sector agro  colombiano,  para que así nuestros agricultores puedan tener más ventajas sobre sus cultivos durante todo las épocas  del año, específicamente esta idea   constituye un sistema de riego automatizado bajo sistemas  control  por sensores de humedad de suelo (sistemas algorítmicos), también  se trata de intervenir con un sistema de purificación  de agua basándose en procesos de ósmosis i', NULL),
(51, 'breaking limits', 'Gyna Patricia Torres Ortiz', 'Carlos Andres Basallo Medina', '1966047', 'Tecnologo en multimedia', 'carlosbasallomedina@hotmail.es', '3219884395', 'crear una pagina con aplicación que nos ayude a tener conocimientos de otras partes del mundo acabando con los mitos y uniéndonos a otras culturas, ayudándonos a  acabar con la xenofobia y aprender otros idiomas interactuando con personas de dichas culturas y lugares.', NULL),
(52, 'OXIGENADORES DE AGUA FOTOVOLTAICO', 'Carlos torres Arge', 'Marisol Viveros Pallares', '1801996', 'técnico en mantenimiento de instalaciones de sistema solar fotovoltaico', 'mviverospallares@gmail.com', '3002493191', 'el prototipo consiste en la  aireación de agua alimentado de energía solar, la cual requeriría entre lo principal un motor DC a  24V 400W y gearbox, dos paneles de de 200W y no requerida energía de aireación instantánea . Solución para eliminar las algas y proporcionar oxígeno\r\nEste prototipo proporcionan la mayor cantidad de oxígeno por Kw/h que cualquier otra forma de aireación.\r\nEs una gran solución para zonas rurales no interconectadas, campesinos que se dedican a la producción de peses en e', NULL),
(53, 'Soldadura ecoamigable', 'Rafael Ahumada', 'Maria Mejia', '2164401', 'Técnico en soldadura en productos metálicos de platina ', 'marmejia817@gmail.com', '3002810341', 'Mi propuesta es estudiar y poner el práctica una soldadura que no sea tan contaminante como la que ahora mismo utilizamos ', NULL),
(54, 'Rayo- Una app para todos!', 'No aplica', 'paolo vittorio mancini villalobos', '2185488', 'tecnico programacion de software', 'pvmancini@gmail.com', '3022411609', 'Para nadie es un secreto el desempleo de este pais incluso a gente que tiene un titulo profesional o varios. Mi idea es a toda esa gente que tenga su titulo de una institucion de educacion superior avalada por el ministerio de educacion nacional,  darle la oportunidad de registrarse en la app y postularse a un pedido - postulacion especifica de acuerdo a su profesion, (el titulo y tarjeta profesional pasara por la debida verificacion y aparte de eso debera hacer una prueba tecnica de conocimient', NULL),
(55, 'Anticonceptivos', 'Ivett pahuana', 'Shelcea paez ', '2185481', 'Análisis de muestras química', 'sdpaez01@misena.edu.com', '3004513678', 'Suminitracion de anticonceptivos mensualmente ', NULL),
(56, 'No tengo ', 'Sivelys Sarmiento ', 'Danna Canchila', '2254374', 'Control de la seguridad digital ', 'danny240699@gmail.com', '3002582069', 'No tengo propuesta pero me gustaría se parte del semillero de investigación  ', NULL),
(57, 'Redes de drenaje para los desagües. ', 'Jeimy Algarin.', 'Yuleidis Maria pinto pabon', '2164420', 'Tecnólogo en Gestión integral de la calidad, Medio ambiente, Seguridad y salud ocupacional.', 'ympinto52@misena.edu.co', '3023147919', 'Colocar redes en lugares estratégicos (como los desagües) donde se aplicarían medidas de prevención para evitar la contaminación en las playas, ríos, océanos, etc.\r\nAsí mismo salvando a la vida marina de daños ocasionados por los generadores de residuos.\r\nNuestra idea es que cada red estratégicamente puesta en los diferentes puntos de desagües logren absorber los residuos orgánicos solidos, Y a su vez el agua logre salir por la red libre de desechos.', NULL),
(58, 'OpenSol', ' Sivelys Sarmiento Crespo', 'Darwin Quiñones Sanchez', '2162723', 'TPS- TÉCNICO EN PROGRAMACIÓN DE SOFTWARE', 'dquinonez3@misena.edu.co', '3135080062', 'Mi idea es fundar una empresa de servicios, dedicada al desarrollo de softwares, aplicaciones móviles, de escritorio y web, basada en los avances tecnológicos y científicos con el fin de innovar y crear mejores productos y servicios que garanticen el progreso de la sociedad hacia un país de tecnologías, con mejores oportunidades laborales y moderno.', NULL),
(59, 'aprendiendo a cuidar el medio ambiente ', 'Manuel Briceño', 'Luis Enrique Rugeles', '2206631', 'implementacion de infraestructura de tecnologias de la informacion y las comunicaciones', 'lerugeles@misena.edu.co', '3006542888', 'Hoy día hay personas que aún no saben de qué forma estamos causándole daño al medio ambiente podría innovar una aplicación en donde el usuario pueda saber que productos le causan daño al medio ambiente, la aplicación funcionaria así \r\n1- el usuario tiene un producto en la mano y él no sabe cuánto daño le hace eso al medio ambiente ni cuánto tiempo demora en deteriorarse  Ej: un teclado.\r\n2- el usuario abre la  App en su móvil enfoca con la cámara el teclado y con inteligencia artificial la App l', NULL),
(60, 'Generación de energía eléctrica con turbinas eólicas a partir de la resistencia del viento generada por vehículos de transporte como solución al consumo energético del alumbrado público y semáforos en la ciudad de Barranquilla.', 'Sin instructor', 'Carlos Francisco Beltrán Rodríguez', '2024262', 'Mantenimiento de equipos de Refrigeración, Ventilación y Climatización', 'carlos.beltran0212@gmail.com', '3003305114', 'La presente idea tiene como finalidad la generación de energía eléctrica con turbinas eólicas a partir de la resistencia generada por los buses y vehículos de transporte al momento de desplazarse por las carreteras, teniendo como objetivo el ahorro energético y uso de energías renovables en Barranquilla aprovechando eficientemente los recursos basándonos en la sostenibilidad.\r\nLa idea consta de una turbina de arrastre tipo savonius de eje vertical cuyo movimiento almacena electricidad en un circ', NULL),
(61, 'Crear un brazo robotico ', 'Natalia ', 'Jesús David Rodríguez benavides ', '2185490', 'Técnico en sistemas ', 'jesusrodriguezbenavides2@gmail.com', '3205142215', 'Crear una prótesis de un brazo robotico que se le pueda ingresar a una persona que necesite y se pueda mover y actuar como un brazo normal ', NULL),
(62, 'Mantenimiento e Instalación y Automatización de Fuentes de Energía Renovable', 'carlos torres', 'eddier semyr molina caballero', '2165830', 'mantenimiento e instalacion de sistemas solares fotovoltaicos', 'esmolina35@misena.edu.co', '3024298754', 'Este proyecto va enfocado a la utilización de la energía renovable como única fuente de energía para abastecer las necesidades tanto para negocios, empresas y hogares de toda la población a nivel nacional e internacional.', NULL),
(63, 'Inteligencia artificial de personal medico ', 'Manuel Salvador Briceño Perez', 'David Giovanni Cortes Rodriguez', '2185498', 'Implementación de infraestructuras de la información y las comunicaciones ', 'vidad.cortesr17@gmail.com', '3184892533', 'Estamos en una época difícil para todos, muchos  enferman no solo de Covid, también de otras enfermedades no diagnosticadas, muchas personas no tienen el privilegio de una eps o un medico familiar si desea hacer consultas breves o complejas de su estado de salud; viendo la problemática de muchos, sin recursos suficientes y con restricciones de salida por la pandemia, se crea una aplicación de inteligencia artificial, con muchos conocimientos médicos, capaz de responder preguntas simples y comple', '2021-05-01'),
(64, 'Diseño de Sistemas y Componentes tecnológicos para la transformación de energía eléctrica a partir de Fuentes Oceánicas y Eólicas', 'Rafael Figueroa', 'Gustavo Caballero Bustos', '2165866', 'Tecnólogo en Mantenimiento Electromecánico Industrial', 'gacb@misena.edu.co', '3147404967', 'El proyecto consiste en desarrollar componentes captadores de la energía potencial de las olas y mareas y luego transmitir potencia a generadores que convertirán a electricidad estas fuentes ecológicas; dentro de los sistemas para construcción y puesta en marcha, encontramos el VIVACE; EL CETO 5, EL GENERADOR DE ACCIONAMIENTO HIDROMECÁNICO y el Sistema SEA GEN entre otros, de alto alcance para la generación de electricidad, como respuesta al cambio climático y los combustibles fósiles, aprovecha', '2021-06-17'),
(65, 'Alert Glasses', 'Manuel Briseño ', 'Luis Rugeles ', '2185498', 'implementacion de infraestructura de tecnologías de la información y las comunicaciones', 'lerugeles@misena.edu.co', '3006542888', ' Los accidentes de tránsito  por lo general se efectúan  cuando la persona conduce con sonñolencia o de repente le da sueño cuando va conduciendo.\r\nMi idea con este proyecto es innovar  unas gafas con sensores de proximidad que cuando la persona que conduce se está quedando dormida al cerrar los ojos por dos segundos las gafas detecten y  emitan un sonido  para que el individuo despierte y evite accidentes.\r\n(Se puede agregar muchas cosas más a estas gafas).', '2022-01-27'),
(66, 'Sistema de parqueadero automatizado para vehículos automotores livianos.', 'Jilmar Ponce', 'Jilmar Ponce', '2450598', 'Bilinguismo', 'poncejilmar@misena.edu.co', '3013058036', 'Buenas noches,\r\nSe trata de la creación de un parqueadero aéreo para carros livianos. Maximizar los espacios reducidos de algún establecimiento, negocio o empresa que no tenga espacio suficiente para aparcar vehículos. Imaginar un edificio solo para carros en dónde el proceso de aparcar sea automático, sin necesidad de estar dentro del vehículo.\r\nGracias.', '2022-02-23'),
(67, 'alert glasses', 'Manuel Briceño', 'Luis Rugeles ', '2185498', 'Implementacion de infraestructura de tecnologías de la información y las comunicaciones ', 'lerugeles@misena.edu.co', '3006542888', 'Los accidentes de tránsito  por lo general se efectúan  cuando la persona conduce con sonñolencia o de repente le da sueño cuando va conduciendo.\r\nMi idea con este proyecto es innovar  unas gafas con sensores de proximidad que cuando la persona que conduce se está quedando dormida al cerrar los ojos por dos segundos las gafas detecten y  emitan un sonido  para que el individuo despierte y evite accidentes.\r\n(Se puede agregar muchas cosas más a estas gafas).', '2022-02-25');
