INSERT INTO `noticia_general` (`id_notig`, `titulo`, `fecha`, `name_img`, `descripcion`, `id_noti`) VALUES
(15, 'BienestarAPP - Aplicativo WEB', '15 Junio, 2018', 'bienestar_app.png', 'Este aplicativo web BienestarAPP fue elaborado por aprendices del programa Análisis y desarrollo de sistemas de información (ADSI) del Centro Colombo Alemán, los cuales hacen parte del semillero de investigación SIDICA + Fabrica de software.\r\nwww.colomboalemanbq.com/encuesta_caracterizacion/', 15),
(16, 'ACIIS - Aplicativo Web', '09 Agosto, 2018', 'new_aciis - copia.png', 'Este aplicativo web ACIIS, fue elaborado por aprendices del programa Análisis y desarrollo de sistemas de información (ADSI) del Centro Nacional Colombo Alemán, los cuales hacen parte del semillero de investigación SIDICA + Fabrica de software.\r\nwww.aciis.co', 16),
(19, 'Taller \"El Internet de las cosas\"', '26 de octubre de 2018', 'INVITACION El Internet De Las Cosas-02.jpg', 'Taller de Divulgación \"El Internet de las cosas\"', 19),
(20, 'II CONGRESO NACIONAL Y I CONGRESO INTERNACIONAL DE CIENCIA, TECNOLOGÍA Y DESARROLLO SOCIAL. HACIA EL DESARROLLO SOSTENIBLE', '11/07/2018 01:05:00 p. m.', 'folleto fabio toloza2 -04.jpg', 'II CONGRESO NACIONAL Y\r\nI CONGRESO INTERNACIONAL DE\r\nCIENCIA, TECNOLOGÍA Y DESARROLLO SOCIAL.HACIA EL DESARROLLO SOSTENIBLE.\r\nHora: 8:00 am a 12:00 am y de 2:00 pm a 6:00 pm', 20),
(21, 'I ENCUENTRO INSTITUCIONAL DE SEMILLEROS DE INVESTIGACIÓN DEL CENTRO NACIONAL COLOMBO ALEMÁN Y CENTRO INDUSTRIAL Y DE AVIACIÓN', '11/06/2018 01:40:00 p. m. ', 'folleto fabio toloza2 -04 (1).jpg', 'Hora: 1:30 p.m.\r\nDía: 7 de Noviembre del 2018\r\nLugar: Salón Múltiple (2do. Piso Del Complejo Industrial)', 21),
(22, 'II CONGRESO NACIONAL Y I CONGRESO INTERNACIONAL DE CIENCIA, TECNOLOGÍA Y DESARROLLO SOCIAL. HACIA EL DESARROLLO SOSTENIBLE', '11/06/2018 10:54:00 a. m.', 'folleto fabio toloza2 -04 (2).jpg', ' SOLO FALTAN 2 DÍAS', 22),
(23, 'Escritura para artículos científicos', '11/02/2018 11:37:00 a. m.', 'ESCRITURA PARA ARTICULOS CIENTIFICOS-01.jpg', '¡No te pierdas esta gran oportunidad!', 23),
(24, 'APRENDICES DEL COLOMBO ALEMÁN CONCURSA EN EL XXI ENCUENTRO NACIONAL Y XV INTERNACIONAL DE SEMILLEROS DE INVESTIGACIÓN - REDCOLSI', '10/17/2018 03:14:00 p. m.', 'EVIDENCIAS-NACIONAL.png', 'El pasado 9 de octubre del 2018, 14 aprendices en compañía de tres instructores del Centro Nacional Colombo Alemán, viajaron a la ciudad de Pasto a representar en el XXI ENCUENTRO NACIONAL Y XV INTERNACIONAL DE SEMILLEROS DE INVESTIGACIÓN ? REDCOLSI, en donde participaron como ponentes y participaron activamente en los diferentes eventos; realizando un intercambio cultural y de conocimientos con las diferentes instituciones que asistieron al evento. ', 24),
(27, '¿Cómo aprender software', '29-11-18', 'Como-aprender-sofware-sin-morir-en-elintento.png', '1 - ¿Cómo aprender software\r\nsin morir en el intento?\r\n2- ¿Cómo desarrollar\r\nágil, rápido y seguro?\r\n3- Innovación en los espacios\r\nde la tecnología', 27),
