(32, 'Vigilancia Científica y Tecnológica ', '29-11-30', 'Vigilancia-cientifica-y-tecnologica.png', 'Taller: Vigilancia Científica y Tecnológica..\r\nEl día 29 de Noviembre de 2018.\r\nHora: 9:00 am a 11:00 am y de  2:00 pm a 4:00 pm', 32),
